const SideBarOption = ({ Icon, title, number, isActive,onClick}) => {
  return (
    <div className={`sidebaroptions ${isActive && "sidebaroptions-active"}`} onClick={onClick}>
      <Icon></Icon>
      <h4>{title}</h4>
      <p>{number}</p>
    </div>
  );
};

export default SideBarOption;
